import React, {Component} from 'react';
import './mani-main.css'
import Accordion from '@material-ui/core/Accordion';
import TabletAndroidIcon from '@material-ui/icons/TabletAndroid';
import AccordionDetails from '@material-ui/core/AccordionDetails';
import AccordionSummary from '@material-ui/core/AccordionSummary';
import AccordionActions from '@material-ui/core/AccordionActions';
import Typography from '@material-ui/core/Typography';
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';
import Chip from '@material-ui/core/Chip';
import Button from '@material-ui/core/Button';
import Divider from '@material-ui/core/Divider';


//use the cip array to show Apps on a tablet
export default class Mani extends Component {
	constructor(props){
		super(props)
		this.state = {
			assetInfo : this.props.data

		}
	}

	async fetchPathData ()  {
		// let start = 1603971032
		// let end = 1608230858
		const { assetInfo : { id=null, gps=null }} = this.state
		console.log('Start',this)

		let bodyData = {
			'params': {
				'id': id,
				'gpsid': gps
				}}
		const makeRequest = await fetch('/path', {
	        method: 'POST',
	        body: JSON.stringify(bodyData),
	        headers: {'Content-Type': 'application/json'}
	    })
	    console.log('End',makeRequest)
		const getPathData = await makeRequest.json()
		console.log(getPathData)
		// if (makeRequest.status === 200) {
		// 	if (getPathData.error) {
		// 		console.log('Error in server bud')
		// 		this.setState({pathexists : false})
		// 	}else{
		// 		if (getPathData.pathresponse[0].id == id) {
		// 			this.setState({data : getPathData.pathresponse[0].events})
		// 			console.log(getPathData.pathresponse[0].id, id)
		// 		}else{
		// 			this.setState({pathexists : false})
		// 		}
		// 	}
		// }
		return 'Done'
	}

	render(){
		console.log(this)
		const { assetInfo : { id=null, gps=null }} = this.state
		console.log('LOG:', id,gps)
		return(
			<div className='mani-holder-container'>
				<Accordion defaultExpanded>
		          <AccordionSummary
		            expandIcon={<ExpandMoreIcon />}
		            aria-controls="panel1c-content"
		            id="panel1c-header"
		          > 
		            <div >
		              <TabletAndroidIcon />
		            </div>
		            <div >
		              <Typography >Select trip destination</Typography>
		            </div>
		          </AccordionSummary>
		          <AccordionDetails>
		            <div  />
		            <div >
		              <Chip label="Barbados" onDelete={() => {}} />
		            </div>
		            <div >
		              <Typography variant="caption"> Select your destination of choice <br />
		                <a href="#secondary-heading-and-columns" > Learn more</a>
		              </Typography>
		            </div>
		          </AccordionDetails>
		          <Divider />
		          <AccordionActions>
		            <Button size="small">Cancel</Button>
		            <Button size="small" color="primary">
		              Save
		            </Button>
		           </AccordionActions>
	           </Accordion>
			</div>
		)
	}
}
